import React from "react";
import "./styles/TabContent.css";

export default React.memo(function TabContent({ children, tabid }){
    return (
        <div className="tabcontent" id={tabid}>
            {children}
        </div>
    );
}, (prevProps, nextProps) => {
    if (nextProps === prevProps){
        return false;
    }
    return true;
}
);
